- input: "TEXT\x1CC00165688\x1CTEXT-00000\x1C\x1CF3XN\x1CASDC Dollars for Democrats,
    the State Democratic Party Victory Fund, and the DSP Joint Victory Fund are joint
    fundraising programs in which the North Carolina Democratic Party participates.
    \  Transfers are made to the NCDP on an as-needed basis.  Please note that state
    party committees have been reporting Memo Entries on Schedule A for contributions
    received by the joint fundraising program during the reporting period in which
    the contribution was received irrespective of whether transfers have been made.
    \ Memo Entries on Schedule A from these programs reflect the gross amounts raised
    while the transfers to the NCDP reflect the net amount distributed to date.  Accordingly,
    there will always be a difference between the transfer and the Memo Schedule A
    totals.  By prior agreement between the NCDP's counsel and the FEC, Memo Schedule
    A's for these programs are reported on a quarterly basis. The NCDP has used its
    best efforts as defined by the FEC to disclose the full identity of all individuals
    who contribute in excess of $200 in a calendar year. All disbursements for Payroll,
    Payroll Taxes, AFLAC Payroll, Supplemental Insurance, and Health Insurance disclosed
    on Schedule H4 are for employees who did NOT spend more than 25% of their compensated
    time in a given month on Federal Election Activity or activities in connection
    with a Federal election. \n"
